import React from 'react';
import '@vkontakte/vkui/dist/vkui.css';
import { Panel, PanelHeader, Div, Button } from '@vkontakte/vkui';

const MainFeed = props => (
    <Panel id={props.id}> 
        <PanelHeader>
            Главная
        </PanelHeader>
            <img style={{height: "50%", width: "50%", marginLeft: "25%"}} alt="" src="https://vk.com/sticker/1-16271-256"/>
        <Div>
            <Button onClick={() => props.this.goToPage("second")} size="xl" mode="secondary">Перейти на вторую панель</Button>
        </Div>
    </Panel>
);
export default MainFeed;
